import React from 'react';

const DataSources = () => {
  return (
    <div className="overview-card">
      <h3>Fuentes de datos</h3>
      <select>
        <option>MINVIVIENDA_AGUA_SANEAMIENTO</option>
      </select>
      <p>Total: 1</p>
    </div>
  );
};

export default DataSources;
